import React from 'react';
import { IonContent, IonItem, IonLabel, IonButton, IonNote, IonList, IonGrid, IonRow, IonCol, IonChip, IonCard, IonCardHeader, IonCardContent, IonCardTitle, IonHeader, IonPage, IonTitle, IonToolbar } from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import { RouteComponentProps } from 'react-router';
import Student from '../components/Student';
import './UserSettings.css';

let test_student = new Student("Carter", 1, "Cal Poly SLO", "ccromer@calpoly.edu", ["social", "recreation", "outdoors", "athletic", "games"]);


const Tab4: React.FC<RouteComponentProps> = (props) => {
  return (
  <IonPage>
    <IonHeader>
      <IonToolbar>
        <IonTitle>User Settings</IonTitle>
      </IonToolbar>
    </IonHeader>
    <IonContent fullscreen>
      
      <IonItem lines="none">
        <IonLabel className="settings-label">
          {"My Info"}
        </IonLabel>
      </IonItem>

      <IonCard>

        <IonCardContent>
          <IonList>
            <IonItem lines="none" className="data" >
              <IonLabel>Name</IonLabel>
              <IonNote slot="end" color="primary">Carter</IonNote>
            </IonItem>
          </IonList>
            

        </IonCardContent>
        
      </IonCard>

      <div className="divider"/>

      <IonItem lines="none">
        <IonLabel className="clubs-label">
          {"My Interests"}
        </IonLabel>
      </IonItem>

      <IonCard>
        <IonCardContent>
          <IonRow>
            <IonGrid>
              <IonChip className="tag">Recreational</IonChip>
              <IonChip  className="tag">Food</IonChip>
              <IonChip className="tag">Poppin'</IonChip>
            </IonGrid>
          </IonRow>
        </IonCardContent>

</IonCard>

    </IonContent>
  </IonPage>
  );
};

export default Tab4;
